import React from "react";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import Calculator from "./pages/Calculator";
import ContactUs from "./pages/ContactUs";
import AskUs from "./pages/AskUs";
import Market from "./pages/Market";
import Login from "./pages/Login";
import Signup from "./pages/Signup";
import FIRE from "./pages/FIRE";
import SIPCalculator from "./components/sip"; // Ensure correct filename
import "./App.css";

function App() {
  return (
    <Router>
      <div className="navbar">
        <div className="navbar-left">
          <h1 className="Logo">SochSahi</h1>
        </div>
        <div className="navbar-right">
          <Link to="/">Home</Link>
          <Link to="/pages/ContactUs">Support Us</Link>
          <Link to="/pages/AskUs">Ask Us</Link>
          <Link to="/pages/Calculator">Calculator</Link>
          <Link to="/pages/FIRE">F.I.R.E</Link>
          <Link to="/pages/Market">Market</Link>
          <Link to="/pages/Login">Login</Link>
          <Link to="/pages/Signup">Sign Up</Link>
          <Link to="/pages/sip">SIP Calculator</Link> {/* Added link */}
        </div>
      </div>

      {/* Routes */}
      <Routes>
        <Route path="/" element={<index />} />
        <Route path="/pages/Calculator" element={<Calculator />} />
        <Route path="/pages/ContactUs" element={<ContactUs />} />
        <Route path="/pages/AskUs" element={<AskUs />} />
        <Route path="/pages/Market" element={<Market />} />
        <Route path="/pages/Login" element={<Login />} />
        <Route path="/pages/Signup" element={<Signup />} />
        <Route path="/pages/FIRE" element={<FIRE />} />
        <Route path="/pages/sip" element={<SIPCalculator />} /> {/* Fixed Route */}
      </Routes>
    </Router>
  );
}

export default App;
